    } var allPathsSourceTarget = function (graph) {
    // 记录所有路径
    let res = [];
    let path = [];

    // 遍历图的所有路径（不包含环）
    // @visualize status(s)
    // @visualize return(path.concat(s))
    var traverse = function (graph, s) {
        // 添加节点 s 到路径
        path.push(s);
        // @visualize color *graph._v(s) #58d77c

        let n = graph.size();
        // 点击下面这一行判断语句，即可看到递归搜索的过程
        if (s === n - 1) {
            // 到达终点
            res.push([...path]);
            // @visualize color *graph._v(s) #unset
            path.pop();
            return;
        }

        // 递归遍历每个相邻节点
        for (let v of graph.neighbors(s)) {
            // @visualize color *graph._e(s,v) #58d77c
            traverse(graph, v);
            // @visualize color *graph._e(s,v) #unset
        }

        // 从路径移出节点 s
        path.pop();
        // @visualize color *graph._v(s) #unset
    };

    traverse(graph, 0);
    return res;
};

